  [],\n\t\"revision_timestamp\": \"2015-08-21T22:53:47.442629\",\n\t\"name\": \"veterans-administration-central-cancer-registry-vaccr\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Veterans Affairs Central Cancer Registry
  (VACCR) receives and stores information on cancer diagnosis and treatment constraints
  compiled and sent in by the local cancer registry staff at each of the 132 Veterans
  Affairs Medical Centers that diagnose and/or treat Veterans with cancer. The information
  sent is encoded to meet the site-specific requirements for registry inclusion as
  established by several oversight bodies, including the North American Association
  of Central Cancer Registries, the American College of Surgeons' Commission on Cancer,
  and the American Joint Commission on Cancer, among others. The information is obtained
  from a wide variety of medical record documents at the local medical center pertaining
  to each Veterans Health Administration (VHA) cancer patient. The information is
  then transmitted to the VACCR. Details collected include extensive demographics,
  cancer identification, extent of disease and staging, first course of treatment,
  and outcomes. Data extraction is available to researchers with VA approved Institutional
  Review Board studies, peer review, and Data Use Agreements.\",\n\t\"license_title\":
